var findAnagrams = function(s, p) {
    const pCount = {};
    const sCount = {};
    const result = [];
    let left = 0, right = 0, count = 0;
    for (let c of p) pCount[c] = (pCount[c] || 0) + 1;
    while (right < s.length) {
        if (pCount[s[right]]) {
            sCount[s[right]] = (sCount[s[right]] || 0) + 1;
            if (sCount[s[right]] <= pCount[s[right]]) count++;
        }
        while (count === p.length) {
            if (right - left + 1 === p.length) result.push(left);
            if (sCount[s[left]] <= pCount[s[left]]) count--;
            sCount[s[left]]--;
            left++;
        }
        right++;
    }
    return result;
};

class Solution {
    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        if(s == null || p == null || s.length() == 0 || p.length() == 0) return res;

        int[] pCount = new int[26];
        for(char c : p.toCharArray()) pCount[c - 'a']++;

        int[] sCount = new int[26];
        int left = 0, right = 0, count = 0;
        while(right < s.length()) {
            if(pCount[s.charAt(right) - 'a'] == 0) {
                left = right + 1;
                count = 0;
                Arrays.fill(sCount, 0);
            } else {
                sCount[s.charAt(right) - 'a']++;
                if(sCount[s.charAt(right) - 'a'] <= pCount[s.charAt(right) - 'a']) count++;
                while(count == p.length()) {
                    if(right - left + 1 == p.length()) res.add(left);
                    if(sCount[s.charAt(left) - 'a'] <= pCount[s.charAt(left) - 'a']) count--;
                    sCount[s.charAt(left) - 'a']--;
                    left++;
                }
            }
            right++;
        }
        return res;
    }
}

