var subsets = function(nums) {
    const result = [];
    const helper = (temp, start) => {
        result.push([...temp]);
        for (let i = start; i < nums.length; i++) {
            temp.push(nums[i]);
            helper(temp, i + 1);
            temp.pop();
        }
    }
    helper([], 0);
    return result;
};

class Solution {
    public List<List<Integer>> subsets(int[] nums) {
        List<List<Integer>> result = new ArrayList<>();
        backtrack(result, new ArrayList<>(), nums, 0);
        return result;
    }

    private void backtrack(List<List<Integer>> result, List<Integer> tempList, int[] nums, int start) {
        result.add(new ArrayList<>(tempList));
        for (int i = start; i < nums.length; i++) {
            tempList.add(nums[i]);
            backtrack(result, tempList, nums, i + 1);
            tempList.remove(tempList.size() - 1);
        }
    }
}

class Solution {

    /**
     * @param String $digits
     * @return String[]
     */
    function letterCombinations($digits) {
        if (empty($digits)) {
            return [];
        }

        $phoneMap = [
            '2' => ['a', 'b', 'c'],
            '3' => ['d', 'e', 'f'],
            '4' => ['g', 'h', 'i'],
            '5' => ['j', 'k', 'l'],
            '6' => ['m', 'n', 'o'],
            '7' => ['p', 'q', 'r', 's'],
            '8' => ['t', 'u', 'v'],
            '9' => ['w', 'x', 'y', 'z']
        ];

        $result = [];
        $this->backtrack($result, '', $digits, $phoneMap);
        return $result;
    }

    private function backtrack(&$result, $current, $remaining, $phoneMap) {
        if (empty($remaining)) {
            $result[] = $current;
            return;
        }

        $digit = $remaining[0];
        $letters = $phoneMap[$digit];

        foreach ($letters as $letter) {
            $this->backtrack($result, $current . $letter, substr($remaining, 1), $phoneMap);
        }
    }
}

